全品！送料無料キャンペーン実施中！<br>(※一部地域除く詳しくはご利用ガイドをご覧ください)オリコンラック　５０Ｂ（長側扉あり）＜br＞
＜br＞
■小さくたたむことで空箱時の容積を小さくすることができ＜br＞
　保管スペースの削減や運送費の削減に繋がります。＜br＞
＜br＞
■片長辺が中折れ式の回転扉となっており＜br＞
段積み時扉を開けた際、下段コンテナの邪魔にならない設計です＜br＞
＜br＞
■外寸：530×366×321mm＜br＞
■内寸：491×333×311mm＜br＞
■有効内寸：490×332×303mm＜br＞
■圧縮荷重：10.57kN（1078kgf）＜br＞
＜br＞
■色：透明・ブルー＜br＞
■材質：PP＜br＞
■内容量：51.1L＜br＞
■折畳み時全高：79mm＜br＞
■特殊機構：片長辺折れ回転扉付＜br＞<img src="http://image.rakuten.co.jp/suncardo/cabinet/sign-banner/700x150-20.jpg" border="0">
