マグネット式より2倍強い！<br>激着ジェルでしっかり吸い付く！ずれにくい！はずれにくい！キズ付きにくい！有効段差28ｃｍまでＯＫ！スチール(鉄)、アルミ(非鉄金属)、木製ドアに対応。多少の凹凸面にもＯＫ！<br>密着ジェル+圧搾レバーの激吸着吸盤式です。<br><br>吸盤サイズ：直径約7.8cm<br>材質：ＡＢＳ樹脂・スチール・合成ゴム・熱可塑性ポリウレタン・ウレタン系エラストマー<img src="http://image.rakuten.co.jp/com/img/home/t.gif" height="1" width="700"><br>
